import React from "react";
import Spritesheet from "react-responsive-spritesheet";

interface CharProps {}

const charComponent: React.FC<CharProps> = (props) => {
  return (
    <div>
      <h1>Char</h1>
      <Spritesheet
        image={`./bringer-of-death.png`}
        direction={`forward`}
        widthFrame={1120}
        heightFrame={744}
        steps={46}
        fps={12}
        timeout={1800}
        autoplay={false}
        loop={true}
        startAt={10}
        endAt={30}
      />
    </div>
  );
};

export default charComponent;
